            overflow: hidden;
        }
        
        #websiteFrame {
            width: 100vw;
            height: 100vh;
            border: none;
            display: block;
        }
        
        .url-overlay {
            position: fixed;

            border-radius: 4px;

            font-size: 14px;
            z-index: 9999;
            max-width: calc(100vw - 40px);
            word-break: break-all;
            backdrop-filter: blur(5px);
        }
    </style>
</head>

                ];
                
                this.currentIndex = 0;
                this.intervalSeconds = 15; // Change website every 60 seconds
                
                this.iframe = document.getElementById('websiteFrame');
                this.urlOverlay = document.getElementById('urlOverlay');
                
                // Start the rotation
                this.start();
            }
            
            start() {
                // Load the first website immediately
                this.loadCurrentSite();
                
                // Set up automatic rotation
                setInterval(() => {
                    this.nextSite();
                }, this.intervalSeconds * 1000);
            }
            
            nextSite() {
                this.currentIndex = (this.currentIndex + 1) % this.websites.length;
                this.loadCurrentSite();
            }
            
            loadCurrentSite() {
                if (this.websites.length > 0) {
                    const currentUrl = this.websites[this.currentIndex];
                    this.iframe.src = currentUrl;
                    
                    // Update overlay with current URL
                    this.urlOverlay.textContent = currentUrl;
                    
                    // Update page title to show current site
                    document.title = `Loading: ${currentUrl}`;
                }
            }
        }
        
        // Start the rotator when page loads
        document.addEventListener('DOMContentLoaded', () => {
            new FullscreenRotator();
        });
